  [],\n\t\"revision_timestamp\": \"2015-05-07T03:31:27.244246\",\n\t\"name\": \"improved-metal-polymeric-laminate-radiation-shielding-project-56dbf\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this proposed Phase II program, builds
  on the phase I feaibility where  a multifunctional lightweight radiation shield
  composite was developed and fabricated. This structural radiation shielding is high
  strength, syntactic polymeric where the polymer is filled with high strength low
  Z material. The phase II program will provide radiation modeling and testing for
  these new structural radiation solutions as well as a physical property database
  for using them in space habitats.  The Phase II program will address issues including
  flammability, attachment, and incorporation of these new materials into existing
  and future space habitat designs.  The accumulation of the phase II program will
  be prototype components that can be tested at TRL level 5 or flown for TRL level
  6.  \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
